// frontend/src/pages/OwnerDashboard.jsx

import React, { useEffect, useState } from 'react';
import api from '../services/api';
import { Card, CardContent } from '@/components/ui/card';

const OwnerDashboard = () => {
  const [summary, setSummary] = useState({
    totalUsers: 0,
    totalCampaigns: 0,
    totalSubmissions: 0,
    totalCaptchaFailures: 0,
    totalOwners: 0,
  });

  useEffect(() => {
    const fetchSummary = async () => {
      try {
        const res = await api.get('/owner/summary');
        setSummary(res.data);
      } catch (err) {
        console.error('Failed to fetch owner dashboard summary:', err);
      }
    };

    fetchSummary();
  }, []);

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-2xl font-bold text-gray-800 mb-6">Owner Dashboard</h1>

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        <Card>
          <CardContent>
            <p className="text-sm text-gray-600">Total Users</p>
            <h2 className="text-3xl font-bold text-indigo-600">{summary.totalUsers}</h2>
          </CardContent>
        </Card>

        <Card>
          <CardContent>
            <p className="text-sm text-gray-600">Total Campaigns</p>
            <h2 className="text-3xl font-bold text-indigo-600">{summary.totalCampaigns}</h2>
          </CardContent>
        </Card>

        <Card>
          <CardContent>
            <p className="text-sm text-gray-600">Total Submissions</p>
            <h2 className="text-3xl font-bold text-indigo-600">{summary.totalSubmissions}</h2>
          </CardContent>
        </Card>

        <Card>
          <CardContent>
            <p className="text-sm text-gray-600">Captcha Failures</p>
            <h2 className="text-3xl font-bold text-indigo-600">{summary.totalCaptchaFailures}</h2>
          </CardContent>
        </Card>

        <Card>
          <CardContent>
            <p className="text-sm text-gray-600">Total Owners</p>
            <h2 className="text-3xl font-bold text-indigo-600">{summary.totalOwners}</h2>
          </CardContent>
        </Card>
      </div>
    </div>
  );
};

export default OwnerDashboard;
